import React, {FC, ReactChild, ReactFragment, ReactNode} from 'react';

export interface GameProps {
    onClick?: () => void,
    width?: string,
    height?: string,
    children: ReactFragment,
    onMouseEnterFunc?: () => void
}

const Game: FC<GameProps> = (
    {
        children,
        onClick,
        width = '300px',
        height = '300px',
        onMouseEnterFunc
    }) => {
    return (
        <div
            onClick={onClick}
            onMouseEnter={onMouseEnterFunc}
            style={{width, height, border: '2px solid black', display: 'flex'}}
        >
            {children}
        </div>
    );

};

export default Game;
